const addRecords = async (patient, doctor) => {
  for (let i = 0; i < 35; i++) {
    if (i % 2 === 0) {
      await axios.post(
        'http://localhost:3001/medical/add-medical-records-on-patients-records',
        {
          patientsWallet: patient,
          doctorWallet: doctor,
          record: medicalDataWithoutAttachmentExemple,
        },
      );
    } else {
      await axios.post(
        'http://localhost:3001/medical/add-medical-records-on-patients-records',
        {
          patientsWallet: patient,
          doctorWallet: doctor,
          record: medicalDataWithAttachmentExemple,
        },
      );
    }
  }
}

